import React from "react";

const PrimeraApp = () => {

    //const saludo = 'Hola Mundo React!';

    const saludo = {
        nombre: 'Omar',
        apellido: "Hdez"
    }

  return (
    <>
      <h1>{ JSON.stringify(saludo,null,3) }</h1>
      <p>Mi primera app con react</p>
    </>
  );
};

export default PrimeraApp;
